    """
        Retorna o mapa pelo nome, por exemplo, CE o mapa retorna o estado do ceará. 
        SP o de sao paulo e assim por diante.
        Recebe: uma sigla (CE,SP,RJ,PI,PE...)
        Retorna: um SVG, contendo um mapa com granularidade de municipio de todo o estado
    """
    def retornar_mapa(self,ano_de_referencia,nome):
        Session = sessionmaker(bind=self.db.engine)
        session = Session()
        municipios = session.query(Municipio).filter(
            or_(
                Municipio.uf==nome,
                Municipio.uf=="PI",
                Municipio.uf=="RN",
                Municipio.uf=="PE",
                Municipio.uf=="PB",
            ),
            Municipio.ano_de_referencia==int(ano_de_referencia)
        ).all()
        mapa = ''
        view = [[],[]]
        for object_muni in municipios:
            mapa += object_muni.malha_g
            viewbox = list(map(float,object_muni.view_box_malha.split()))
            view[0].append(viewbox[0])
            view[1].append(viewbox[1])
        session.close()
